import React from 'react';


function Filters() {
  return (
  <>
  <h1>CATEGORIES</h1>
	  <div className="check">
			 <input type="checkbox" /> Flip Flops <br/>
			 <input type="checkbox" /> Sneakers   <br/>
			 <input type="checkbox" /> Lace-Up shoes <br/>
			 <input type="checkbox" /> Shoe Accessories <br/>
	 </div>
	 <hr/>
  </>
  );
}

export default Filters;
